 /* document.write('<script type="text/javascript" id="contentloadtag" defer="defer" src="javascript:void(0)"><\/script>')

  var _timer=setInterval(function(){
  if(/loaded|complete/.test(document.readyState)){
    clearInterval(_timer)
    init() // call target function
  }}, 10)
}

function onLoadFunction() {
	setTimeout("if (!alreadyrunflag) init()", 0);
	doIEsearch();
	fetchValue();
	respondToSearchLoad();
	window.focus();
}

function submitValue(){
	var windowLocation=window.location.href;
	var searchLocation=windowLocation.split("#");
	window.location=searchLocation[0]+"#"+document.getElementById('sh_term').value;
	fetchValue();
}

function fetchValue() {
	if(window.top.location==window.location) {
		document.getElementById('hidediv').style.display="block";
        }


	var flag=true;
	var searchStringFound=false;

	var arg = getArgs();
	if (arg['q']) {
	  searchStr = arg['q'];
	  searchStringFound = true;
	}

	if(flag) {
	  if (searchStringFound) {
	    document.getElementById('sh_term').value=searchStr;
	    document.search.submit();
	  }
	
	  if(parent.titlebar!=null) {
	    parent.titlebar.document.getElementById("propertiesLink").style.display="none";
	    parent.titlebar.document.getElementById("propertiesBar").style.display="none";
	    parent.titlebar.document.getElementById("packagePropertiesLink").style.display="none";
